import React, {useState}  from "react";
import './post.css'

const Post = (props) => {
    const {id, url, title} = props
    const [count, setCount] = useState(0)
    return (
        <div class="fields">
        <img id="post" alt={id} src={url}></img>
        <p>{title}</p>
        <button onClick={()=>setCount(count+1)}>button</button> <span>{count}</span>
    </div>
    )
}

export default Post;
